import React, { Component } from 'react';
import {Row, Col, Breadcrumb, CardHeader, CardBody} from 'reactstrap';
import { Route} from 'react-router-dom';
import Breadcrumbs from './Breadcrumbs';
import Header from './Header';
import ProductList from './ProductList';
import Product from './Product';
import Footer from './Footer'
import {createBrowserHistory} from 'history';

const history = createBrowserHistory();

class Canvan extends Component{
	constructor(props) {
		super(props);
		this.state = {}
    }

	render(props){
        const pos = {pag:"12", center:{size: 10, offset: 1}}
		return(
            <Row>
                <Col xs={pos.pag} sm={pos.pag} md={pos.pag}>
                    <CardHeader>
                        <Col xs={pos.center} sm={pos.center} md={pos.center}>
                            <Header history={history} propsUp={this.props}/>
                        </Col>
                    </CardHeader>
                    <Breadcrumb>
                        <Col xs={pos.center} sm={pos.center} md={pos.center}>
                            <Breadcrumbs/>
                        </Col>
                    </Breadcrumb>
                    <CardBody>
                        <Col xs={pos.center} sm={pos.center} md={pos.center}>
                            <Route path="/" render={(props) => (<ProductList {...props} isAuthed={true} />)} exact/>
                            <Route path="/items" render={(props) => (<ProductList {...props} isAuthed={true} />)} exact/>
                            <Route path="/items/:id" render={(props) => (<Product {...props} isAuthed={true} />)} exact/>
                        </Col>
                    </CardBody>
                    <CardBody>
                        <Col xs={pos.center} sm={pos.center} md={pos.center}>
                            <Footer/>
                        </Col>
                    </CardBody>
                </Col>
            </Row>
		)	
	}
}

export default Canvan;
